// Header.js
import React from 'react';

function Header({ query, setQuery, handleSearch }) {
  return (
    <header>
      <span class="google-text">Google</span>
      <input
        type="text"
        value={query}
        onChange={(e) => setQuery(e.target.value)}
      />
      <button onClick={handleSearch}>Search</button>
    </header>
  );
}

export default Header;
